import { default as Card, initCard } from './components/card/card.js';

(async function (document) {
  const app = document.querySelector('#app');
  const skeleton = app.querySelector('.skeleton');
  const listPage = app.querySelector('[page=list]');
  
  skeleton.removeAttribute('active');
  listPage.setAttribute('active', '');

  const link = document.createElement('link');
  link.rel = 'stylesheet';
  link.href= './js/components/card/card.css';
  document.head.appendChild(link);

  try {
    const data = await fetch('./data/spacex.json');
    const json = await data.json();
    
    const cards = json.map(item => {
      const constructor = document.createElement('div');
      constructor.innerHTML = Card;
      const cardElement = constructor.querySelector('.card');

      initCard(item.image,
        item.placeholder,
        item.content.title,
        item.content.description, cardElement);

      listPage.appendChild(cardElement);

      return cardElement;
    });

    const callback = function(entries) {
      entries.forEach(entry => {
        if (entry.isIntersecting) {
          const image = entry.target;
          const placeholder = image.parentNode.querySelector('.placeholder');
          image.src = image.dataset.src;
          image.onload = function() {
            placeholder.classList.add('fade');
          }
        }
      });
    };
  
    const io = new IntersectionObserver(callback);
    cards.forEach(card => {
      const image = card.querySelector('img');
      io.observe(image);
    });
  } catch (error) {
    console.error(':(');
  }
})(document);

